import React, { useState } from "react";
import InputField from "../Fields/Field.component";
import { visibilityIcon, visibilityOffIcon } from "../utils/Icons";
import "./registrationForm.style.css";

const AddProductForm = () => {
  const [inputValue, setInputValue] = useState({ name: "", price: "" });
  const { name, price } = inputValue;

  const handleChange = (e) => {
    const { name, value } = e.target;
    setInputValue((prev) => ({
      ...prev,
      [name]: value,
    }));
    console.log(inputValue);
  };

  const formHeader = () => {
    return (
      <div className="header-container">
        <h2>Sign up</h2>
        <span>
          Already have an account? <a href="">Sign in</a>
        </span>
      </div>
    );
  };

  return (
    <>
      <form className="form-container">
        {formHeader()}
        <div className="form-wrapper">
          <div className="form-header">
            <InputField
              type="text"
              value={name}
              placeholder=""
              label="Suffix"
              name="Suffix"
              className="inputField-header"
              onChange={handleChange}
            />
            <InputField
              type="text"
              value={price}
              placeholder=""
              label="Title"
              name="Title"
              className="inputField-header"
              onChange={handleChange}
            />
            <InputField
              type="text"
              value={name}
              placeholder=""
              label="Firstname"
              name="Firstname"
              className="inputField-header"
              onChange={handleChange}
            />
            <InputField
              type="text"
              value={price}
              placeholder=""
              label="Lastname"
              name="Lastname"
              className="inputField-header"
              onChange={handleChange}
            />
          </div>
          <div className="form-body">
            <div className="email-box">
              <InputField
                type="email"
                value={name}
                placeholder=""
                label="Email"
                name="Email"
                className="inputField-body"
                required={true}
                onChange={handleChange}
              />
              <p className="email-description">
                Click the checkbox to use email us predefined sign in option
              </p>
            </div>
            <InputField
              type="text"
              value={price}
              placeholder=""
              label="Username"
              name="Username"
              className="inputField-body"
              required={true}
              onChange={handleChange}
            />
          </div>
          <div className="form-bottom">
            <InputField
              type="text"
              value={name}
              placeholder=""
              label="Country Code"
              name="countryCode"
              className="inputField-bottom"
              required={true}
              onChange={handleChange}
            />
            <InputField
              type="text"
              value={price}
              placeholder=""
              label="Phone Number"
              name="phoneNumber"
              className="inputField-bottom"
              onChange={handleChange}
            />
            <div>
              <InputField
                type="password"
                placeholder=""
                label="Password"
                name="password"
                className="inputField-bottom"
                required={true}
                onChange={handleChange}
              />
              <span>
                {visibilityIcon()}
              </span>
            </div>

            <InputField
              type="password"
              placeholder=""
              label="Confirm Password"
              name="confirmPassword"
              className="inputField-bottom"
              required={true}
              onChange={handleChange}
            />
          </div>
          <div className="btn-submit">
            <InputField
              type="button"
              value="Create account"
              placeholder=""
              className="form-submit"
            />
          </div>
        </div>
      </form>
    </>
  );
};

export default AddProductForm;
